import './App.css';
import { useState } from 'react';
import { Landing } from './Landing-page/Landing-page.js';
import { UploadDownload } from './Upload-Download-page/Upload-Download-page.js';

Landing.setUpload();

function App() {

  const [ready, setReady] = useState(false)

  function flipwebsites() {
    (Landing.upload() && Landing.codesubmit()) ? (
        setReady()
      ):(
        <Landing/>
        )
  }


  return (
    <div>
      {
        ready ? (
          <UploadDownload/>
        ) : (
          <Landing/>
          )
      }
    </div>
  );
}

export default App;
